import React from "react";
import { Link } from "react-router-dom";


const Footer = () => {
  return (
    <div className="footer">

    <Link to="/">Home</Link>

    <Link to="/AllPosts">Blog</Link>

    <Link to="/AboutMe">About</Link>

    </div>
  )
}

export default Footer;
